ESX = nil
TriggerEvent('esx:getSharedObject', function(obj) ESX = obj end)

local zajete = {}
local lastprzejete = {}
local xPlayer = ESX.GetPlayerFromId(source)
local CDstrefy = 1 --w minutach


ESX.RegisterServerCallback("w_org_strefy:check", function(source,cb, id)
    local time = os.date("*t")
    local _source = source
    local czymozna = false
    if time.hour >= GodzinaOd then
        czymozna = true
    end
    if czymozna then
    for _,v in pairs(zajete) do
        if v.id == id then
            --Ktos juz przejmuja ta strefe
            msg("Ktoś już przejmuje strefę", _source)
            cb(false)
            return
        end
    end
    for _,v in pairs(lastprzejete) do
        if v.id == id then
            msg("Niedawno ktoś już przejmował tą strefę", _source)
            cb(false)
            return
        end
    end
    table.insert( zajete,{id = id, id2 = _source})
    table.insert( lastprzejete,{id = id})

    Citizen.SetTimeout(60000*CDstrefy, function()
        for k,v in pairs(lastprzejete) do
            if v.id == id then
                table.remove(lastprzejete, k)
                return
            end
        end
      end)
    TriggerClientEvent('w_org_strefy:warn', -1, id)
    cb(true)
else
    msg("Nie możesz jeszcze przejmować stref", _source)
end
end)

RegisterServerEvent('w_org_strefy:przejmij')
AddEventHandler('w_org_strefy:przejmij', function(id, org)
    local xPlayer = ESX.GetPlayerFromId(source)
    local i = 1
    for _,v in pairs(zajete) do
        if v.id2 == source then
            table.remove( zajete, i )
            break
        end
        i=i+1
    end
  
    MySQL.Sync.execute("UPDATE w_org_strefy SET nazwa = @nazwa WHERE id = @id",{['@nazwa'] = org, ['@id'] = id})
    TriggerClientEvent('w_org_strefy:blip', -1)
  
end)


RegisterServerEvent('w_org_strefy:przerwij')
AddEventHandler('w_org_strefy:przerwij', function(yup)
    local i = 1
    local _source = source
    for _,v in pairs(zajete) do
        if v.id2 == source then
            table.remove( zajete, i )
      
            if _source ~= v.id then
                TriggerClientEvent('w_org_strefy:warn', -1, v.id, "Twoja strefa została odbita")
            end
            break
        end
        i=i+1
    end
  
end)

